  const loadAllCustomerData = async () => {
    const res = await fetch(
      "https://script.google.com/macros/s/AKfycbzO5XQjeJdPPZPzpTx91GyOKvrylyo03jEZHmXEskmCHGXvDYDXQQGudLuVUQvIsPZEww/exec?action=getAllCustomerData"
    );
    const result = await res.json();

    if (result.success && Array.isArray(result.customers)) {
      const grouped = {};

      result.customers.forEach((row) => {
        const srn = row["Service Request Number"];
        if (!grouped[srn]) {
          grouped[srn] = { ...row, partsUsed: [] };
        }

        grouped[srn].partsUsed.push({
          partNumber: row["Part Number"],
          description: row["Description"],
          quantity: row["Quantity"],
          note: row["Note"] || row["Note "] || row["Note\t"],
        });
      });

      // const finalData = Object.values(grouped);
      const finalData = Object.values(grouped).sort((a, b) => {
        const srnA = parseInt(a["Service Request Number"], 10);
        const srnB = parseInt(b["Service Request Number"], 10);
        return srnB - srnA; // Sort descending (largest first)
      });

      setRawCustomerData(finalData);
      setCustomerDataList(finalData);
      setFilteredData(finalData);

      // ✅ Prevent overwriting selectedRecord while modal is open
      if (!editModalOpen && selectedRecord) {
        const updatedRecord = finalData.find(
          (rec) =>
            rec["Service Request Number"] ===
            selectedRecord["Service Request Number"]
        );
        if (updatedRecord) {
          setSelectedRecord(updatedRecord);
        }
      }
    }
  };

  const handleSearchAndFilter = () => {
    let filtered = [...rawCustomerData];

    if (searchText.trim()) {
      const lower = searchText.toLowerCase().trim().replace(/\s+/g, " ");

      filtered = filtered.filter((item) => {
        return Object.entries(item).some(([key, value]) => {
          // Skip arrays and objects
          if (Array.isArray(value) || typeof value === "object") return false;

          const text = (value ?? "")
            .toString()
            .toLowerCase()
            .replace(/\s+/g, " ");

          return text.includes(lower);
        });
      });
    }

    if (searchInstallationDate) {
      const searchDate = dayjs(
        searchInstallationDate,
        ["DD-MM-YYYY", "YYYY-MM-DD"],
        true
      );

      filtered = filtered.filter((item) => {
        const rawDate = item["Installation Date"];
        const parsed = parseDate(rawDate);

        return (
          parsed?.isValid() &&
          searchDate.isValid() &&
          parsed.isSame(searchDate, "day")
        );
      });
    }

    // Filter by SRN
    if (searchSRN.trim()) {
      filtered = filtered.filter(
        (item) =>
          item["Service Request Number"]?.toString().trim() === searchSRN.trim()
      );
    }

    setCustomerDataList(filtered);
  };

